import React, { useState } from 'react';

const MultipleInputs = () => {

    const [userRegistration , setUserRegistration] = useState({
        username:"",
        email:"",
        phone:"",
        password:""
    });

    const handleInput = (e) => {
        const name = e.target.name;
        const value = e.target.value;
        console.log(name,value);

        setUserRegistration({...userRegistration,[name]:value})
    }
    
    const [records , setRecords] =useState([]);

    const handleSubmit = (e) => {
        e.preventDefault();

        const newRecoer = {...userRegistration, id:new Date().getTime().toString() }
        setRecords([...records,newRecoer]);
        console.log(setRecords);
    }

    return(
       <>
       <form action="" onSubmit={handleSubmit}>
           <div>
               <label htmlFor="username">Full Name</label>
               <input type="text" autoComplete="off" value={userRegistration.username} onChange={handleInput} name="username" id="username"/>
            </div>
            <div>
               <label htmlFor="email">Email</label>
               <input type="text" autoComplete="off" value={userRegistration.email} onChange={handleInput} name="email" id="email"/>
            </div>
            <div>
               <label htmlFor="phone">Phone</label>
               <input type="text" autoComplete="off" value={userRegistration.phone} onChange={handleInput} name="phone" id="phone"/>
            </div>
            <div>
               <label htmlFor="password">Password</label>
               <input type="text" autoComplete="off" value={userRegistration.password} onChange={handleInput} name="password" id="password"/>
            </div>
            
            <button type="submit">Register</button> 
          
       </form>
       </>
    )
};

export default MultipleInputs;
